import React from 'react';

const SelectedElement = (props) => {
    let SelectedEle = props.selected.map((el) => {

        return console.log(el).id;

    }) 
    return ( 
        <div>
           {SelectedEle}
        </div>
     );
}

export default SelectedElement;
